import React, { Component } from 'react';
import FileUpload from './fileUpload';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Footer from './footer';
import Navi from './navi';

function Home () {
    return (
        <>
        <Navi></Navi>
        <FileUpload></FileUpload>
        <Footer></Footer>
        </>
    );
}

export default Home;
